import { useState } from 'react';
import Expenses from './components/Expenses/Expenses';

import NewExpense from './components/NewExpense/NewExpense';

const INITIAL = [
    {
        id: 'e1',
        title: 'Toilet Paper',
        amount: 94.12,
        date: new Date(2020, 7, 14),
    },
    {
        id: 'e2',
        title: 'New TV',
        amount: 799.49,
        date: new Date(2021, 2, 12),
    },
    {
        id: 'e3',
        title: 'Car Insurance',
        amount: 294.67,
        date: new Date(2021, 2, 28),
    },
    {
        id: 'e4',
        title: 'New Desk (Wooden)',
        amount: 450,
        date: new Date(2021, 5, 12),
    },
];

const App = () => {
    const [new_inf, Setnew_inf] = useState(INITIAL);

    const callNewExpense = (expense) => {
        Setnew_inf((prevState) => {
            return [expense, ...prevState];
        });
    };

    console.log(new_inf);

    return (
        <div>
            <NewExpense onNewExpense={callNewExpense}></NewExpense>
            <Expenses items={new_inf}></Expenses>
        </div>
    );
};

export default App;
